    [],nt"revision_timestamp": "2016-07-27T23:01:59.945236",nt"name": "widespread-mortality-of-adult-seabirds-in-alaska-august-september-1983",nt"isopen":
    false,nt"url": null,nt"notes": "A widespread die-off of adult seabirds,
    affecting primarily the black-legged kittiwake (Rissa tridactyla), and short-tailed
    shearwater (Puffinus tenuirostris), occurred in the northern and western Gulf of
    Alaska as well as in portions of the Bering and Chukchi seas between 10 August and
    30 September 1983. All carcasses were greatly emaciated with little fat and much
    atrophy of pectoral muscles. These findings support our preliminary conclusions
    that the die-off was related to severe stress caused by malnutrition. Birds evaluated
    were seabirds, Black-legged Kittiwake, Short-tailed Shearwater, Murres, Northern
    Fulmar, Sooty Shearwater, and Red-legged Kittiwake. Locations include Gulf of Alaska,
    Cook Inlet, Prince William Sound, Middleton Island, Kodiak Island, Chignik, Alaskan
    Peninsula, Egegik, Kotzebue, and Aleutian Islands.",nt"license_title": "License
